import React, { useEffect, useState } from 'react';
import { useParams } from "react-router-dom"
import classes from './ProductPage.module.css';
import {data} from '../../data/data';

// type ProductPage = {
//   onClick?: () => void
// }
// type Description = {
//   manufacturer?: string,
//   loadСapacity?: string,
//   TippingLoad?: string,
//   OperatingWeight?: string,
//   UnloadingHeight?: string,
//   Engine?: string,
//   EnginePower?: string,
//   HydraulicFlow?: string,
//   TireSize?: string,
//   Control?: string,
//   FuelCapacity?: string,
//   BucketIncluded?: string,
//   DrivingSpeed?: string 
// }

// type Page = {
//   titleProduct?: string,
//   nameLinkProduct?: string,
//   imgProduct?: string,
//   description?: Description
// }

// type Product = {
//   title: string,
//   nameLink: string,
//   img: string,
//   pages: Page
// }
export default function ProductPage() {
    const {id} = useParams();
    const param = id;
    let dataP;
    for (let i = 0; i < data.length; i+=1) {
      const d1 = data[i].pages;
      for (let j = 0; j < d1.length; j+=1) {
        const d2 = d1[j];
        if (d2.nameLinkProduct == param) {
          dataP = d2;
        }
      }
    }
    console.log(param, dataP?.description);
  return (
    <main className={classes.catalog_product__container}>
        <h3 className={classes.catalog_product_title}>{dataP?.titleProduct}</h3>
        <div className={classes.catalog_product_wrapper}>
          <img src = {dataP?.imgProduct} alt = 'Погрузчик' className={classes.catalog_product_img}/>
          <div className={classes.catalog_product__description}>
            <span className={classes.catalog_product__description_text}>Технические характеристики</span>
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Производитель: {dataP?.description.manufacturer}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Грузоподъемность: {dataP?.description.loadСapacity}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Нагрузка опрокидывания: {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Эксплуатационная масса: {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Высота выгрузки (по шарниру ковша): {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Двигатель: {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Мощность двигателя: {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Гидравлический поток: {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Размер шин: {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Управление: {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Объем топливного бака: {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Объем ковша в комплекте: {}</span> : null}
            {dataP?.description ? <span className={classes.catalog_product__description_text}>Скорость движения: {}</span> : null}
          </div>
        </div>
    </main>
  );
}
